import { useState } from "react";
import Front from "./front";
import "./Main.css";
import AfterPatientLoginBlock from "./Main/Login_Reg/AfterLogin/AfterPatientLogin/AfterPatientLoginBlock";


const Main = () => {
    const [logornot,setLogOrNot] = useState();
    const isPatLog = localStorage.getItem("Patient Log");    
    if (isPatLog === "true") {
        setLogOrNot(<AfterPatientLoginBlock/>)       
    } else {
        setLogOrNot(<Front/>)
    }
    return(
      <>
        {logornot}
      </>
    );
}


export default Main;
